function partition(s: string): string[][] {
    const res: string[][] = [];
    const path: string[] = [];
    const dfs = (index: number) => {
        if (index === s.length) {
            return res.push([...path]);
        }
        let tempStr = '';
        for (let i = index; i < s.length; i++) {
            tempStr += s[i]
            if(tempStr !== [...tempStr.split('')].reverse().join(''))continue;
            path.push(tempStr);
            dfs(i + 1)
            path.pop()
        }
    }
    dfs(0)
    return res
};
